package com.keduo.entity;

public class Menu {
	private int mid;
	private String mname;
	private String url;
	private int mmid;
	public Menu() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Menu(int mid, String mname, String url, int mmid) {
		super();
		this.mid = mid;
		this.mname = mname;
		this.url = url;
		this.mmid = mmid;
	}
	public int getMid() {
		return mid;
	}
	public void setMid(int mid) {
		this.mid = mid;
	}
	public String getMname() {
		return mname;
	}
	public void setMname(String mname) {
		this.mname = mname;
	}
	public String getUrl() {
		return url;
	}
	public void setUrl(String url) {
		this.url = url;
	}
	public int getMmid() {
		return mmid;
	}
	public void setMmid(int mmid) {
		this.mmid = mmid;
	}
	@Override
	public String toString() {
		return "Menu [mid=" + mid + ", mname=" + mname + ", url=" + url + ", mmid=" + mmid + "]";
	}
	
}
